def compute_betweenness_probabilities(G):
	weights=[]
	original_nodes = list(G.nodes())
	bc =precomputed_bc#betweenness_centrality(G)
	#print(bc)
	sum=0
	for o_n in original_nodes:
		sum+=bc[o_n]
		weights.append(bc[o_n])
	for w in weights:
		idx = weights.index(w)
		weights[idx]= round(max(weights)-w,2)
	return weights


def split_network_to_graph_and_incremental_nodes(G,percentage_incremental):
	final_nodes = list(G.nodes())
	
	graph_nodes = []
	incremental_nodes=[]
	incremental_nodes_to_select = int(percentage_incremental*len(final_nodes)/100)
	weights = compute_betweenness_probabilities(G)
	tolerance = 2*incremental_nodes_to_select

	while (len(incremental_nodes) < incremental_nodes_to_select and tolerance>0):
		tolerance-=1
		#select randomly a node with a 1-(betweeness centrality) probability distribution
		tmp = G.subgraph(final_nodes)
		K = random.choices(final_nodes,weights)
		RN=K[0]
		
		neighboors_degree = tmp.degree(tmp[RN])
		#accept this node and in case delete it from the list for next steps if no isolated nodes have been created
		discard=False
		for element in neighboors_degree:
			if element[1] == 1 or tmp.degree(RN)==1:
				discard = True
			
				#print("\tDiscarded "+str(RN))
		if not discard:
			idx_remove = final_nodes.index(RN)
			final_nodes.pop(idx_remove)
			weights.pop(idx_remove)
			incremental_nodes.append(RN)
			#print("Selected "+str(len(incremental_nodes))+"/"+str(incremental_nodes_to_select))
	#Check if out of tolerance
	if tolerance == 0:
		print("Out of tolerance")
		return None,None,False
	#Check if no isolated nodes have been created
	t = G.subgraph(final_nodes)
	degrees = [k[1] for k in t.degree()]
	if min(degrees) ==0:
		return None,None,False
	#############################################
	S_graph = G.subgraph(final_nodes)
	return S_graph, incremental_nodes,True

